class UtilityClass  {
    
    _builder = null;
    _id = null;

    constructor(builder){

        // Set Builder
        this._builder = builder;

        // Generate Incremental ID
        this._id = this._builder.count();
    }
}

class ComponentClass extends UtilityClass {

    _bootstrap = null;
    _selector = null;
    _options = {};
    _callback = null;
    _component = null;
    _properties = {};
    _counter = 0;

    constructor(builder, param1 = null, param2 = null, param3 = null){
        
        // Call Parent
        super(builder);

        // Set Self
        const self = this;

        // Set selector, options, and callback
        [param1, param2, param3].forEach(param => {
            if(param !== null){
                if (typeof param === 'string' || param instanceof jQuery) {
                    if(typeof param === 'string'){
                        param = $(param);
                    }
                    self._selector = param;
                } else if (typeof param === 'object') {
                    self._options = param;
                } else if (typeof param === 'function') {
                    self._callback = param;
                }
            }
        });

        // Init Component
        this._init();

        // Configure Options
        this.config(this._options);

        // Create Component
        this._create();
        
        // Execute Callback
        if(typeof this._callback === 'function'){
            setTimeout(() => this._callback(this, this._component), 0);
        }

        // Timeout
        setTimeout(() => this._timeout(), 0);

        // Insert Component
        this._insert();
    }

    _debug(){
        console.log(this);
    }

    _create(){}

    _init(){}

    _timeout(){}

    _config(name,options){
        if(typeof this._properties[name] !== 'undefined'){
            switch(name){
                default:
                    this._properties[name] = options;
                    break;
            }
        }
    }

    _insert(){
        // Check if Selector is Set
        if(this._component && this._selector){

            // Append to Selector
            this.appendTo(this._selector);
        }
    }

    _count(){
        this._counter++;
        return this._counter;
    }

    config(options = null){

        // Check if Options is Set
        if(options == null){
            options = this._options;
        }

        // Configure Options
        for(const [key, value] of Object.entries(options)){
            if(typeof this._properties[key] !== 'undefined'){
                switch(key){
                    case"callback":
                    case"properties":
                        for(const [k, v] of Object.entries(value)){
                            if(typeof this._properties[key][k] !== 'undefined'){
                                this._properties[key][k] = v;
                            }
                        }
                        break;
                    case"class":
                        for(const [section, classes] of Object.entries(value)){
                            if(this._properties[key][section] != null){
                                this._properties[key][section] += ' ' + classes;
                            } else {
                                this._properties[key][section] = classes;
                            }
                        }
                        break;
                    default:
                        if(typeof value === 'object'){
                            this._config(key,value);
                        } else {
                            this._properties[key] = value;
                        }
                        break;
                }
            }
        }

        // Return Object
        return this;
    }

    appendTo(object){
        
        // Append Object To
        this._component.appendTo(object);

        // Return Object
        return this;
    }

    prependTo(object){
        
        // Prepend Object To
        this._component.prependTo(object);

        // Return Object
        return this;
    }

    append(object){
        
        // Append Object
        this._component.append(object);

        // Return Object
        return this;
    }

    prepend(object){
        
        // Prepend Object
        this._component.prepend(object);

        // Return Object
        return this;
    }

    text(){

        // Return Object
        return this._component.text();
    }

    html(){

        // Return Object
        return this._component.html();
    }

    outerHTML(){

        // Return Object
        return this._component[0].outerHTML;
    }

    show(){

        // Show Object
        this._component.show();

        // Return Object
        return this;
    }

    hide(){

        // Hide Object
        this._component.hide();

        // Return Object
        return this;
    }
}

class FileUtility extends UtilityClass {

    #callbacks = {
        upload: function(){},
        view: function(){},
        download: function(){},
        delete: function(){},
    };

    #file = {
        name: null,
        type: null,
        data: null,
        decoded: null,
        url: {
            iframe: null,
            download: null,
        },
    };

    constructor(builder, file){
        
        // Call Parent
        super(builder);

        // Set Self
        const self = this;
        
        // Check if File is Object
        if(typeof file === 'object'){
            self.set(file);
        }
    }

    set(file){

        // Set Self
        const self = this;

        // Set File
        for(const [key, value] of Object.entries(file)){

            // Check if key is set
            if(typeof self.#file[key] !== 'undefined'){

                switch(key){
                    case"url":
                        for(const [type, url] of Object.entries(value)){
                            if(typeof self.#file.url[type] !== 'undefined'){
                                self.#file.url[type] = url;
                            }
                        }
                        break;
                    default:
                        self.#file[key] = value;
                        break;
                }
            }
        }

        // Decode File
        self.#file.decoded = self.decode(self.#file.data);
    }

    callback(name, callback){

        // Set Self
        const self = this;

        // Check if Callback is Set
        if(typeof callback === 'function'){
            if(typeof self.#callbacks[name] !== 'undefined'){
                self.#callbacks[name] = callback;
            }
        }

        // Return
        return self;
    }

    upload(){

        // Set Self
        const self = this;
    }

    getMimeType() {

        // Set Self
        const self = this;

        // Extrac extension
        var extension = self.#file.name.split('.').pop().toLowerCase();

        // Set MIME Type
        var mimeType;
        switch (extension) {
            case "png":
                mimeType = 'image/png';
                break;
            case "jpg":
            case "jpeg":
                mimeType = 'image/jpeg';
                break;
            case "gif":
                mimeType = 'image/gif';
                break;
            case "bmp":
                mimeType = 'image/bmp';
                break;
            case "pdf":
                mimeType = 'application/pdf';
                break;
            case "doc":
            case "docx":
                mimeType = 'application/msword';
                break;
            case "xls":
            case "xlsx":
                mimeType = 'application/vnd.ms-excel';
                break;
            case "txt":
                mimeType = 'text/plain';
                break;
            // add more extensions and MIME types as needed
            default:
                mimeType = 'application/octet-stream'; // default to binary data
        }

        // Return MIME Type
        return mimeType;
    }

    _isURL(str) {
        try {
            new URL(str);

            return true;
        } catch (_) {
            return false;
        }
    }

    decode(filedata){

        // Set Self
        const self = this;

        // Check if data is null, if yes, return null
        if (filedata === null) {
            return null;
        }

        // Check if data is a data URI, if yes, extract the Base64 part
        if (typeof filedata === 'string') {

            // Check if data is a data URI
            if(filedata.startsWith('data:')){
                filedata = filedata.split(',')[1];
            } else {

                // Check if data is a URL
                if(this._isURL(filedata)){
                    return filedata;
                }
            }
        }

        // Check if data is Uint8Array, if yes, just return it
        if (filedata instanceof Uint8Array) {
            return filedata;
        }
    
        // Check if data is a valid Base64 string
        if(typeof filedata === 'string' && this._builder.Helper.isBase64(filedata)){
    
            // Decode Base64
            filedata = atob(filedata);
            
            // Retrieve Length
            var len = filedata.length;
    
            // Create Bytes
            var bytes = new Uint8Array(len);
    
            // Loop through bytes
            for (var i = 0; i < len; i++) {
                bytes[i] = filedata.charCodeAt(i);
            }
    
            // Return Bytes
            return bytes;
        }
    
        throw new Error("Invalid input: expected Base64 string or Uint8Array");
    }

    createBlob(mimeType) {

        // Set Self
        const self = this;
    
        // Create a Blob from the Uint8Array
        var blob = new Blob([self.#file.decoded], { type: mimeType });
        
        // Return Blob
        return blob;
    }

    view(){

        // Set Self
        const self = this;

        // Set icon based on filetype
        var icon = 'file-earmark';
        switch(self.#file.type){
            case"spreadsheet":
            case"excel":
            case"document":
            case"word":
            case"richtext":
            case"powerpoint":
            case"slides":
            case"slideshow":
                return self.download();
            case"image":
                icon = 'file-image';
                break;
            case"pdf":
                icon = 'file-pdf';
                break;
            case"onlyoffice":
            case"nextcloud":
                icon = 'cloud-download';
                break;
            case"text":
                icon = 'file-text';
                break;
        }

        // Set MIME Type
        var mimeType = this.getMimeType(self.#file.name);

        // Set Blob
        var blob = this.createBlob(mimeType);

        // Create Modal
        const modal = self._builder.Component(
            'modal',
            {
                class: {
                    modal: null,
                    dialog: null,
                    content: null,
                    header: null,
                    body: null,
                    footer: null,
                },
                callback: { //Add Callbacks
                    submit: function(element,modal){ //On Submit
                        console.log("Submit", element,modal);
                    },
                    cancel: function(element,modal){ //On Cancel
                        console.log("Cancel", element,modal);
                    },
                    fullscreen: function(element,modal){ //On Fullscreen Toggle
                        console.log("Fullscreen", element,modal);
                        if(element.dialog.hasClass('modal-fullscreen')){
                            element.body.find('.embed-responsive').removeClass('vh-60').addClass('h-100');
                        } else {
                            element.body.find('.embed-responsive').removeClass('h-100').addClass('vh-60');
                        }
                    },
                    close: function(element,modal){ //On Close
                        console.log("Close", element,modal);
                    },
                    onShow: function(element,modal){ //On Show
                        console.log("Show", element,modal);
                    },
                    onHide: function(element,modal){ //On Hide
                        console.log("Hide", element,modal);
                    },
                },
                onEnter: false,
                close:true,
                fullscreen:true,
                destroy:false,
                icon: icon,
                title: self.#file.name,
                cancel: true,
                submit: false,
                size: "xl",
            },
            function(component, element){
                console.log("Modal", component, element);

                // Remove Modal Body Padding
                element.body.addClass('p-0');

                // Change Cancel Label
                element.footer.cancel.text('Close');

                // Open modal
                component.show();

                // Set Modal Body
                switch(self.#file.type){
                    case"image":
                        var frame = $(document.createElement('div'))
                            .addClass('d-flex justify-content-center align-items-center min-vh-50')
                            .appendTo(element.body);
                        var url = URL.createObjectURL(blob);
                        var image = $(document.createElement('img'))
                            .addClass('img-fluid')
                            .attr('alt', self.#file.name)
                            .attr('src', url)
                            .appendTo(frame)
                            .on('load', function() {
                                URL.revokeObjectURL(url);
                            });
                        break;
                    case"pdf":
                        var frame = $(document.createElement('div'))
                            .addClass('embed-responsive embed-responsive-16by9 vh-60')
                            .appendTo(element.body);
                        var url = URL.createObjectURL(blob);
                        var pdf = $(document.createElement('iframe'))
                            .addClass('embed-responsive-item w-100 h-100')
                            .attr('src', url)
                            .appendTo(frame)
                            .on('load', function() {
                                URL.revokeObjectURL(url);
                            });
                        break;
                    case"onlyoffice":
                    case"nextcloud":
                        var frame = $(document.createElement('div'))
                            .addClass('embed-responsive embed-responsive-16by9 vh-60')
                            .appendTo(element.body);
                        var iframe = $(document.createElement('iframe'))
                            .addClass('embed-responsive-item w-100 h-100')
                            .attr('src',self.#file.url.iframe)
                            .appendTo(frame)
                            .on('load', function() {

                                // Remove Header
                                URL.revokeObjectURL(url);
                            });
                        break;
                    case"text":
                        var text = self._builder.Component(
                            "form",
                            element.body,
                            {
                                class:{
                                    component: null,
                                    form: null,
                                    input: null,
                                    label: null,
                                    field: null,
                                },
                                callback:{
                                    submit: function(form){},
                                    val: function(form){ console.log(form); },
                                    reset: function(form){ console.log(form); },
                                },
                            },
                            function(form,element){
                                console.log("Form", form, element);
                                form.add(
                                    {
                                        name: 'text',
                                        type: 'ide',
                                    },
                                    function(input,form){

                                        // Remove Label
                                        input.label.remove();

                                        // Remove Border Radius
                                        input.input.addClass('rounded-0');

                                        // Insert text content
                                        var reader = new FileReader();
                                        reader.onload = function(e) {
                                            input.val(e.target.result);
                                        }
                                        reader.readAsText(blob);
                                    },
                                );
                            },
                        );
                        break;
                }
            },
        );
    }

    download(){

        // Set Self
        const self = this;

        // Create Anchor
        var anchor = $(document.createElement('a'))
            .attr('download', self.#file.name)
            .css("display", "none")
            .appendTo('body');
        
        // Set MIME Type
        switch(self.#file.type){
            case"onlyoffice":
            case"nextcloud":
                anchor.attr('href', self.#file.url.download);
                break;
            default:
                anchor.attr('href', self.#file.data);
                break;
        }

        // Click Anchor
        anchor[0].click();

        // Remove Anchor
        anchor.remove();
    }

    delete(){

        // Set Self
        const self = this;

        // Set icon
        var icon = 'exclamation-octagon';

        // Create Modal
        const modal = self._builder.Component(
            'modal',
            {
                class: {
                    modal: null,
                    dialog: null,
                    content: null,
                    header: null,
                    body: null,
                    footer: null,
                },
                callback: { //Add Callbacks
                    submit: function(element,modal){ //On Submit
                        console.log("Submit", element,modal);
                    },
                    cancel: function(element,modal){ //On Cancel
                        console.log("Cancel", element,modal);
                    },
                    close: function(element,modal){ //On Close
                        console.log("Close", element,modal);
                    },
                    onShow: function(element,modal){ //On Show
                        console.log("Show", element,modal);
                    },
                    onHide: function(element,modal){ //On Hide
                        console.log("Hide", element,modal);
                    },
                },
                onEnter: false,
                close:true,
                fullscreen:false,
                destroy:false,
                icon: icon,
                title: "Are you sure?",
                cancel: true,
                submit: true,
            },
            function(component, element){
                console.log("Modal", component, element);

                // Set body text
                element.body.text('Are you sure you want to delete ' + self.#file.name + '?');

                // Change Submit Label
                element.footer.submit.text('Delete');

                // Open modal
                component.show();
            },
        );
    }
}

class FilesComponent extends ComponentClass {

    #files = {};

    _init(){
        this._properties = {
            class: {
                component: null,
                list: null,
            },
            callback: {
                upload: function(file){},
                add: function(file){},
                remove: function(file){},
            },
        };
    }

    _create(){
        
        // Set Self
        const self = this;

        // Create Component
        this._component = $(document.createElement('div')).attr({
            'id': 'component' + this._id,
        });
        this._component.id = this._component.attr('id');

        // Set Component Class
        if(this._properties.class.component){
            this._component.addClass(this._properties.class.component);
        }

        self._component.list = self._builder.Component(
            'list',
            self._component,
            {
                class: {
                    component: "rounded w-100 border-0",
                },
            },
            function(list, component){
                // Set List Class
                if(self._properties.class.list){
                    component.addClass(self._properties.class.list);
                }
                list.add(
                    {
                        actions: false,
                    },
                    function(item,list){
                        item.prependTo(component);
                        item.container.attr({
                            "class": "input-group",
                        }).html('');
                        item.input = $(document.createElement('input')).attr({
                            "type": "file",
                            "class": "form-control form-control-sm",
                            "aria-label": "Upload",
                            "multiple": true,
                        }).appendTo(item.container);
                        item.submit = $(document.createElement('button')).attr({
                            "type": "button",
                            "class": "btn btn-sm btn-success px-3",
                        }).text('Upload').appendTo(item.container);
                        item.submit.icon = $(document.createElement('i')).addClass('bi bi-upload me-1').prependTo(item.submit);
                    },
                );
            },
        );
    }

    add(file){
            
        // Set Self
        const self = this;

        // Set File
        if(typeof file === 'object'){

            // Sanitize File
            if(typeof file.name === 'undefined'){
                console.log("File name is required");
                return self;
            }
            if(typeof file.type === 'undefined'){
                console.log("File type is required");
                return self;
            }
            if(typeof file.data === 'undefined'){
                file.data = null;
            }
            if(typeof file.url === 'undefined'){
                file.url = {};
                file.url.iframe = null;
                file.url.download = null;
            }
            file.id = self._count();

            // Create Utility
            file.utility = new FileUtility(self._builder, file);

            // Set Icon
            var icon = "file-earmark";

            // Set File Properties
            switch(file.type){
                case"image":
                    if(typeof file.data === 'undefined'){
                        console.log("File data is required");
                        return self;
                    }
                    icon = 'file-image';
                    break;
                case"pdf":
                    if(typeof file.data === 'undefined'){
                        console.log("File data is required");
                        return self;
                    }
                    icon = 'file-pdf';
                    break;
                case"powerpoint":
                    if(typeof file.data === 'undefined'){
                        console.log("File data is required");
                        return self;
                    }
                    icon = 'file-slides';
                    break;
                case"word":
                    if(typeof file.data === 'undefined'){
                        console.log("File data is required");
                        return self;
                    }
                    icon = 'file-word';
                    break;
                case"excel":
                    if(typeof file.data === 'undefined'){
                        console.log("File data is required");
                        return self;
                    }
                    icon = 'file-excel';
                    break;
                case"text":
                    if(typeof file.data === 'undefined'){
                        console.log("File data is required");
                        return self;
                    }
                    icon = 'file-text';
                    break;
                case"onlyoffice":
                case"nextcloud":
                    if(typeof file.url === 'undefined'){
                        console.log("File urls are required");
                        return self;
                    }
                    icon = 'cloud';
                    break;
            }

            // Save File
            self.#files[file.id] = file;

            // Create Utility
            self._component.list.add(
                {
                    icon: icon, //Icon
                    field: file.name, //Add Content to the list item
                    click: function(){
                        self.view(file.id);
                    },
                },
                function(item,list){
                    self.#files[file.id].item = item;
                    item.actions = $(document.createElement('div')).addClass('flex-shrink-1 btn-group').appendTo(item.container);
                    item.actions.view = $(document.createElement('button'))
                        .addClass('btn btn-sm btn-primary')
                        .attr('type','button')
                        .on('click', function(){
                            self.view(file.id);
                        })
                        .appendTo(item.actions);
                    item.actions.view.icon = $(document.createElement('i')).addClass('bi bi-eye').prependTo(item.actions.view);
                    item.actions.download = $(document.createElement('button'))
                        .addClass('btn btn-sm btn-secondary')
                        .attr('type','button')
                        .on('click', function(){
                            self.download(file.id);
                        })
                        .appendTo(item.actions);
                    item.actions.download.icon = $(document.createElement('i')).addClass('bi bi-download').prependTo(item.actions.download);
                    item.actions.delete = $(document.createElement('button'))
                        .addClass('btn btn-sm btn-danger')
                        .attr('type','button')
                        .on('click', function(){
                            self.delete(file.id);
                        })
                        .appendTo(item.actions);
                    item.actions.delete.icon = $(document.createElement('i')).addClass('bi bi-trash').prependTo(item.actions.delete);
                },
            );
        }

        // Return self
        return self;
    }

    view(id){

        // Set Self
        const self = this;

        // Check if ID is Set
        if(typeof this.#files[id] !== 'undefined'){
            self.#files[id].utility.view();
        }
    }

    download(id){

        // Set Self
        const self = this;

        // Check if ID is Set
        if(typeof this.#files[id] !== 'undefined'){
            self.#files[id].utility.download();
        }
    }

    delete(id){

        // Set Self
        const self = this;

        // Check if ID is Set
        if(typeof this.#files[id] !== 'undefined'){
            self.#files[id].utility.delete();
        }
    }
}

